    <div>
      <div>
        <input
          type="email"
          required
          name="email"
          placeholder="Email Address"
          value={emailConf}
          onChange={(e) => {
            setEmailConf(e.target.value);
          }}
        />
      </div>
      <div>
        <input
          type="password"
          required
          name="password"
          placeholder="Password"
          value={passwordConf}
          onChange={(e) => {
            setPasswordConf(e.target.value);
          }}
        />
      </div>

      <div>
      <input variant="primary" type="submit" onClick={login}>
                                        Log In
                                    </input>
      </div>
    </div>
  );
}

export default test;
